INSERT INTO `plugin_translation` VALUES (_binary '\Õ\”ˆ^òGb•ˇäıÚRá',_binary '/ª_\‚\‚öMp™XT\Œ|\„\‚','PayPal Products for Shopware 6','Get access to over 100 currencies and 200 markets worldwide with the payment module PayPal for your Shopware shop. Experience an easy and comfortable way of payment.','https://store.shopware.com/en/shopware-ag.html','https://issues.shopware.com/','{\"0.9.0\": [\"First version of the PayPal integrations for Shopware 6\"], \"1.0.0\": [\"PT-11181, PT-11275 - Add PayPal PLUS integration\", \"PT-11277 - The cart and order number submitting is now active by default\"], \"1.1.0\": [\"PT-11276 - Add banner for advertising installments\"], \"1.1.1\": [\"PT-11443 - Solves an issue with the error handling with the paypal credentials\", \"PT-11475 - Improved processing of vouchers during checkout\"], \"1.2.0\": [\"PT-11233 - Do not show PayPal Express Button on the product detail page, if the product is in clearance\", \"PT-11292 - Add possibility to enter separate credentials for sandbox mode\"], \"1.3.0\": [\"PT-10448 - Adds onboarding to get API credentials with PayPal login in settings module\", \"PT-11292 - Adds possibility to enter separate credentials for sandbox mode in first run wizard\", \"PT-11498 - Adds PayPal Express Button to QuickView from CMS Extensions plugin\", \"PT-11550 - Fix usage of sandbox credentials after an update\"], \"1.4.0\": [\"PT-11540 - Corrects remaining amount for multiple partial refunds\", \"PT-11541 - Improved behaviour of multiple partial refunds & captures\", \"PT-11606 - Shopware 6.2 compatibility\"], \"1.5.0\": [\"NEXT-8322 - Shopware 6.2 compatibility\", \"PT-10654 - Activate and set PayPal as default for the selected Saleschannel in the settings module\", \"PT-11599 - Fixes a bug where PayPal Plus could not be configured individually per Saleschannel\"], \"1.5.1\": [\"PT-10640 - Fix SalesChannel api routes\", \"PT-10897 - Locale code validation for Smart Payment Buttons and Express Checkout\", \"PT-112